INNER JOIN `tbl_opd_patient` ON `tbl_gynec`.`Crno` = `tbl_opd_patient`.`CRNO` AND `tbl_gynec`.`series` = `tbl_opd_patient`.`Series`
LEFT JOIN `tbl_gynec_procedure` ON `tbl_gynec`.`ID` = `tbl_gynec_procedure`.`gynec_id`
WHERE DATE_FORMAT(tbl_gynec.doa,'%Y-%m-%d') >= '2018-10-05'
AND DATE_FORMAT(tbl_gynec.doa,'%Y-%m-%d') <= '2018-10-05'
GROUP BY `tbl_gynec`.`ID`
ORDER BY `tbl_gynec`.`ID` DESC
